import React, { Component } from 'react'

class Home extends Component {
    render() {
        if(sessionStorage.getItem("userName")==null){
            return 
        }
        else{
            return (
                <div>
                    <h1>This is Home</h1>
                </div>
            )
        }

    }
}
export default Home
